"fixed": |-
  -  Each Job has a name, which is not necessarily unique.  The Client optionally supplies this name in the Job Creation request.  If the Client does not supply this name, the Printer generates a name for the Job.  The Job's "job-name" attribute contains the name.
"ko": |-
  - 각 작업에는 이름이 있지만 반드시 고유할 필요는 없습니다. 클라이언트는 선택적으로 작업 생성 요청에 이 이름을 제공합니다. 클라이언트가 이 이름을 제공하지 않으면 프린터는 작업에 대한 이름을 생성합니다. 작업의 "job-name" 속성에는 이름이 포함됩니다.
